import classes from './Buttons.module.css';

const Buttons = ({text, ArchiveHref}) => {
  return (
    <div className={classes.BtnContainer}>
      <button className={classes.MainBtn}><a href={ArchiveHref}>{text}</a></button>
    </div>
  ) 
}

export default Buttons;
